import React,{useContext} from "react";
import {
  Button,
  Card,
  Container,
  Row,
  Col,
} from "react-bootstrap";
import TableOmnibusHead from "./TableOmnibusHead";
import TableOmnibusBody from "./TableOmnibusBody";
import OmnibusContext from "context/OmnibusContext";

const TableOmnibus = () => {
  const { setModalShow } = useContext(OmnibusContext);

  return (
    <>
      <Container>
        <Row>
          <Col xs="12" sm="6" md="4" >
            <Card className="strpied-tabled-with-hover">
              <Card.Header className="d-flex justify-content-between">
                <TableOmnibusHead />
                <Button
                  onClick={setModalShow}
                  type="Submit"
                  className="btn-fill "
                  variant="success"
                >
                  Adicionar Omnibus
                </Button>
              </Card.Header>
              <Card.Body className="table-full-width table-responsive px-0">
                <TableOmnibusBody                 
                />
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default TableOmnibus;
